import React from 'react'
import { Navigate } from 'react-router-dom';
import { useAuth } from './auth'

const RequiredAuth = ({ children }) => {
    const auth = useAuth()

    if (!auth.tokenID) {
        return <Navigate to='/login' />
    }

    return children
}

export default RequiredAuth
